import React from 'react';
import Set from './Set/Set';
import Home from './Home/Home'
import { Switch, Route } from 'react-router-dom';

const App = () => {
    return (
        <div>
            <Switch>
                <Route exact path ="/" component={Home}/>
                <Route exact path="/dashboard/set" component={Set} />
            </Switch>
        </div>
    );
};

export default App;
